import React, { Component } from 'react'
import Match from './Match'
class Matches extends Component {

    render(){
        return(
            <div>
                {this.props.matches.map(match => <Match key={match.id} when={match.when} est_id={match.establishment_id} establishments={this.props.establishments}/>)}
            </div>
        )
    }

}

export default Matches
